import React, { useState } from 'react';
import {  Routes , Route , Link } from "react-router-dom";
import Project1Web from './project1Web';
import Project1App from './project1App';





export default function Project1() {



  return (
    <div className='project1' >
     
       <div className="project1_nav">
       <button > <Link style={{textDecoration:"none"}} to="/project_zifcare/web_version" >Zifcare web</Link> </button>
         <button > <Link  style={{textDecoration:"none"}} to="/project_zifcare/app_version" >Zifcare app</Link></button>
       </div>
        <Routes>
        <Route  path="web_version"  element={<Project1Web />} />
        <Route path="app_version"  element={<Project1App />} />
        </Routes>
      



      
    </div>
  )
}
